import React from 'react';
import { StyleSheet } from 'react-native-web';
import { NavigationContainer } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';

import Feed from "./Feed";
import Bookings from './Bookings';
import Favorites from './Favorites';

const Tab = createBottomTabNavigator();

const BottomTab = () => {
    return (
        <Tab.Navigator
            screenOptions={{
                tabBarStyle: {
                    position: 'absolute',
                    bottom: 25,
                    left: 20,
                    right: 20,
                    elevation: 0,
                    backgroundColor: '#ffffff',
                    borderRadius: 15,
                    height: 90,
                    ...styles.shadow
                },
                tabBarShowLabel: false,
            }}
        >
            <Tab.Screen name="TablÃ³n" component={Feed} />
            <Tab.Screen name="Mis reservas" component={Bookings} />
            <Tab.Screen name="Favoritos" component={Favorites} />
        </Tab.Navigator>
    );
};

const styles = StyleSheet.create({
    shadow: {
        shadowColor: '#7F5DF0',
        shadowOffset: {
            width: 0,
            height: 10,
        },
        shadowOpacity: 1.25,
        shadowRadius: 3.5,
        elevation: 5
    }
});

const App = () => {
    return(
        <NavigationContainer>
            <BottomTab />
        </NavigationContainer>
    );
};

export default App;
